import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
    state: {
        getRandomProfile: {}
      },
      mutations: {
        setgetRandomProfile(state, data) {
          state.getRandomProfile = data;
        }
      }
})
